from sympy import isprime
from sympy import prime
for n in range(1, 10**6):
  s=prime(n)
  lst = []
  for i in str(s):
    if i != '0':
      lst.append(int(i))
  if isprime(s+min(lst)) and isprime(s-min(lst)):
    print(s, end=', ')
